(13,10063,'notes',NULL,'Founded in 1972, Second Harvest Food Bank Santa Cruz County was the first food bank in California and is the second oldest in the nation. In Santa Cruz County, 1 in 3 people face hunger. Hunger is not inevitable. Weâ€™re working hard to feed people who need food now and to advocate for policies that tackle the root causes of hunger. We reach people in need through our vast network of partner agencies and non-profits and directly through food distribution and nutrition education at dozens of program sites. Every month, 65,000 local residents count on us to avoid missing meals, empty stomachs, and impossible choices between food, housing, medicine, and other necessities.','Changed notes to Founded in 1972, Second Harvest Food Bank Santa Cruz County was the first food bank in California and is the second oldest in the nation. In Santa Cruz County, 1 in 3 people face hunger. Hunger is not inevitable. Weâ€™re working hard to feed people who need food now and to advocate for policies that tackle the root causes of hunger. We reach people in need through our vast network of partner agencies and non-profits and directly through food distribution and nutrition education at dozens of program sites. Every month, 65,000 local residents count on us to avoid missing meals, empty stomachs, and impossible choices between food, housing, medicine, and other necessities.','2024-07-09 20:44'),
